INSERT INTO `sys_oper_log` (`oper_id`, `title`, `business_type`, `method`, `request_method`, `operator_type`, `oper_name`, `dept_name`, `oper_url`, `oper_ip`, `oper_location`, `oper_param`, `json_result`, `status`, `error_msg`, `oper_time`, `cost_time`) VALUES (18206, '测试用例提示词', 1, 'com.cat2bug.web.controller.system.SysCasePromptController.add()', 'POST', 1, 'demo', NULL, '/system/CasePrompt', '127.0.0.1', '内网IP', '{\"casePromptContent\":\"需求规格内容：重要程度 重要 优先程度 优先 功能描述 增加模拟序列步骤 前置条件 已登录，并进入模拟态并打开某变电站接线图 输入 事件流 1、在接线图中选择设备，右击，从弹出的快捷菜单中选择“模拟分”或“模拟合”菜单项，如果设备实时状态为分，则显示“模拟合”菜单，如果设备实时状态为合，则显示“模拟分”菜单。 2、点击菜单项时将当前模拟序列GUID、设备ID、设备目的状态等内容发送到模拟服务进行防误校验（电网防误校验和序列防误校验），显示校验结果。 3、校验结果通过后，点击确定按钮，将当前的模拟步骤添加到当前模拟序列中。 二、角色：您是一位卓越且专业的测试用例编写大师，能够依据详尽完备的上下文和清晰明确的需求，精确无误、迅速高效且科学合理地创作测试用例，并严谨妥善地安排其优先级 三、测试用例信息如下： 3.1、测试用例字段：标题（要求：依据上述需求的内容进行功能点的总结与提炼）、等级（要求：依据上述需求的重要程度与优先级进行填写）、前置条件、预期、步骤（要求：内容应具体详尽且丰富，不少于 15 个字）。同时，测试用例字段中的步骤字段，要精准，避免歧义，保证不同的人对用例都有一致的理解，坚决杜绝出现“正常情况”“异常情况”“特殊情况”“验证”等表述。 3.2、测试用例生成：1. 依据上述需求的内容，始终紧扣需求核心重点，精心优化，精心构建细致周全、有效验证需求的测试用例，务必保证所有测试用例的字段内容 生成必须正确无误、完整且没被遗漏;2. 测试用例严禁重复;3. 每个测试用例应有单独的测试点，确保每个测试用例只测一点;4. 测试用例中应写清 测试的操作步骤，不同操作步骤相对应的操作结果;4. 生成的测试用例条数为10条。 一、需求规格内容：重要程度 重要 优先程度 优先 功能描述 停止模拟 前置条件 已登录，并进入模拟态 输入 事件流 1、如果当前模拟序列的状态等于“草稿”并且已开始模拟，则按钮显示为“停止模拟”，如果当前模拟序列的状态等于“草稿”并且已停止模拟，则按钮显示为“继续模拟”。 2、在点击“停止模拟”按钮时，当前模拟序列停止模拟操作，通知模拟服务恢复设备状态、摘待操作牌。模拟序列不再是模拟中状态，步骤中的设备状态恢复操作前状态，设备的模拟序号也消失。“停止模拟”按钮变为“继续模拟”，也可开启新的“开始模拟”操作。 二、角色：您是一位卓越且专业的测试用例编写大师，能够依据详尽完备的上下文和清晰明确的需求，精确无误、迅速高效且科学合理地创作测试用例，并严谨妥善地安排其优先级 三、测试用例信息如下： 3.1、测试用例字段：标题（要求：依据上述需求的内容进行功能点的总结与提炼）、等级（要求：依据上述需求的重要程度与优先级进行填写）、前置条件、预期、步骤（要求：内容应具体详尽且丰富，不少于 15 个字）。同时，测试用例字段中的步骤字段，要精准，避免歧义，保证不同的人对用例都有一致的理解，坚决杜绝出现“正常情况”“异常情况”“特殊情况”“验证”等表述。 3.2、测试用例生成：1. 依据上述需求的内容，始终紧扣需求核心重点，精心优化，精心构建细致周全、有效验证需求的测试用例，务必保证所有测试用例的字段内容 生成必须正确无误、完整且没被遗漏;2. 测试用例严禁重复;3. 每个测试用例应有单独的测试点，确保每个测试用例只测一点;4. 测试用例中应写清 测试的操作步骤，不同操作步骤相对应的操作结果;4. 生成的测试用例条数为10条。\",\"casePromptId\":\"ba7c58fd-0a73-4995-866c-f184546a2358\",\"createTime\":\"2024-10-19 00:06:19\",\"params\":{},\"projectId\":50,\"updateById\":214}', '{\"msg\":\"操作成功\",\"code\":200}', 0, NULL, '2024-10-19 00:06:19', 12);
